DROP database if exists payroll;
CREATE DATABASE PAYROLL;
USE PAYROLL;

CREATE TABLE EMPLOYEE (
employee_no int,
gender char(20),
ethnicity char(20),
PRIMARY KEY (employee_no)
);

CREATE TABLE PAY (
employee_no int,
pay_year int,
crc int,
reg_pay int,
other_pay int,
benefit int,
overtime int,
total int,
PRIMARY KEY (employee_no)
);

CREATE TABLE JOB (
employee_no int,
title LONGTEXT,
job_class_pgrade char(20),
PRIMARY KEY (employee_no)
);

CREATE TABLE DEPARTMENT (
employee_no int,
depart_no int,
depart_title LONGTEXT,
PRIMARY KEY (employee_no)
);




